import {TopBar} from "./App";
import  './voice.css';
import {useEffect, useState} from "react";
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import CardContent from "@mui/material/CardContent";
import Card from "@mui/material/Card";


const Voice = () => {
    const [imageBase64, setImageBase64] = useState('');
    const[imageBase64_2, setImageBase64_2] = useState('');
    const[title, setTitle] = useState('');

   useEffect(() => {
        let uuid = new URLSearchParams(window.location.search).get('uuid');
        if (uuid) {
            fetch(`/voice?uuid=${uuid}`)
                .then(response => response.json())
                .then(data => {
                    setImageBase64(data.pitch_image);
                    setImageBase64_2(data.intensity_image);
                    setTitle(data.title);
                    console.log(data.title)
                })
                .catch(error => {
                    console.error('Error:', error);
                });
        }
    }, []);

  return (
      <>
          <TopBar />
          <div>
              <div className="video-card">
                  <Card sx={{ maxWidth: '80%', marginTop: 5, width: 'auto'}}>
                      <CardContent>
                          <video width="100%" controls>
                              <source src={`/static/${title}`} type="video/mp4" />
                              Your browser does not support the video tag.
                          </video>
                      </CardContent>
                  </Card>
              </div>
              <Accordion>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel1a-content" id="panel1a-header">
                      <Typography>Summary</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                           <p>title</p>
                      </Typography>
                  </AccordionDetails>
              </Accordion>
              <Accordion>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel2a-content" id="panel2a-header">
                      <Typography>Pitch</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                          {imageBase64 && <img src={`data:image/png;base64,${imageBase64}`} alt="Generated Plot" className="responsiveImage" />}
                      </Typography>
                  </AccordionDetails>
              </Accordion>
              <Accordion>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel2a-content" id="panel2a-header">
                      <Typography>Intensity</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                          {imageBase64_2 && <img src={`data:image/png;base64,${imageBase64_2}`} alt="Generated Plot" className="responsiveImage" />}
                      </Typography>
                  </AccordionDetails>
              </Accordion>
          </div>
      </>
  );
}
export default Voice;
